import React from "react";

const Note = ({ note, onDelete }) => (
  <div
    style={{
      backgroundColor: note.color,
      padding: "10px",
      margin: "10px",
      borderRadius: "5px",
    }}
  >
    <h3>{note.title}</h3>
    <p>{note.content}</p>
    <button onClick={() => onDelete(note.id)}>Delete</button>
  </div>
);

export default Note;
